// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.0;

import "./VJMToken.sol";
import "./JMToken.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Staking is Ownable {
    event Staked(address indexed from, uint256 amount);
    event UnStaked(address indexed from, uint256 unStakedTime);
    event UnStakedClaimed(address indexed from, uint256 unStakedTime, uint256 amount);
    event Claimed(address indexed from, uint256 amount);

    uint256 public Deploytime; //  
    uint256 public decimals = 10**18;
    uint32 public APR = 150; // 
    uint32 private yearsDuration = 31536000;
    uint32 private dayDuration = 86400;
    uint256 private stakingExpire = dayDuration * 3; //   3  // test = 180 -> 3
    VJMToken vJmt;  //   
    JMToken jmt; //   

    struct StakeInfo {        
        uint256 startTS; //  
        uint256 claimedTime; //    
        uint256 unStakingTime; //  
        uint256 amount; //  
        uint256 totalClaimed; //  decimals 
        uint32 state; //   ==1, unstaking==2
    }

    mapping(address => StakeInfo) public stakeInfos; //    
    mapping(address => bool) public addressStaked;  //   

    constructor(VJMToken _tokenAddress) { // staking  erc20   
        require(address(_tokenAddress) != address(0),"Token Address cannot be address 0");                
        vJmt = _tokenAddress;
        Deploytime = block.timestamp;
    }

    //     
    modifier Claimable(uint256 amount) {
        require(jmt.balanceOf(address(this)) > amount, "TOKEN_LACK");
        _;
    }

    function setJMTokenAddress(JMToken _jmt) external onlyOwner{
        require(address(jmt) == address(0),"ADDRESS IS NOT Zero Address");
        jmt = _jmt;
    }

    //set stakeInfoe startTime // get stakeinfos(address)  
    function setStakeInfo() public {
        stakeInfos[msg.sender].claimedTime = block.timestamp;
    }


    // 
    function stakeToken(uint256 stakeAmount) public payable Claimable(stakeAmount) returns(bool){
        require(stakeAmount > 0, "Stake amount should be correct"); //  
        require(addressStaked[msg.sender] == false, "You already participated"); //  
        //     
        if(stakeInfos[msg.sender].state == 2){
            return false;
        }

        bool success = vJmt.increaseContractAllowance(
            msg.sender, 
            address(this),
            stakeAmount
        );
        require(success,"IncreaseContract Fail");
        vJmt.transferFrom(msg.sender, address(this), stakeAmount); // vjmt 
        addressStaked[msg.sender] = true;

        stakeInfos[msg.sender] = StakeInfo({                
            startTS: block.timestamp,
            claimedTime: block.timestamp, //  
            unStakingTime: 0,
            amount: stakeAmount, //  
            totalClaimed: 0,
            state: 1
        });

        emit Staked(msg.sender, stakeAmount);
        return true;
    }   

    // 
    function unStakingToken() public payable {
        require(addressStaked[msg.sender] == true, "You already participated"); //  

        // staking  
        uint256 stakingDuration = block.timestamp - stakeInfos[msg.sender].claimedTime; //     
        uint256 persecondAmount = (stakeInfos[msg.sender].amount * APR / 100) / yearsDuration / dayDuration; //   
        uint256 claimableAmount = persecondAmount * stakingDuration; //  
        jmt.transfer(msg.sender, claimableAmount / 10); //vjmt:jmt1:10  

        stakeInfos[msg.sender].unStakingTime = block.timestamp; //   
        addressStaked[msg.sender] = false; //   
        stakeInfos[msg.sender].state = 2; //    

        emit UnStaked(msg.sender, block.timestamp); //jmt 
        emit Claimed(msg.sender, claimableAmount); // vjmt
    }

    //   
    function unStakingClaime() public payable returns(bool,uint256){
        require(stakeInfos[msg.sender].state == 2, "now State is Staking, Please UnStaking!!");
        if(stakeInfos[msg.sender].unStakingTime + stakingExpire < block.timestamp){ //  
            uint256 amount = stakeInfos[msg.sender].amount; //   
            vJmt.transfer(msg.sender,amount); //  

            delete stakeInfos[msg.sender]; //    
            delete addressStaked[msg.sender]; //     
            emit UnStakedClaimed(msg.sender, block.timestamp, amount);
            return(true, block.timestamp);
        }else{ //   
            uint256 remainingTime = (stakeInfos[msg.sender].unStakingTime + stakingExpire) - block.timestamp; //   
            return(false, remainingTime);
        }

    }


    //  
    function claimReward() external returns (bool){
        require(addressStaked[msg.sender] == true, "You are not participated");

        uint256 stakingDuration = block.timestamp - stakeInfos[msg.sender].claimedTime; //     
        uint256 persecondAmount = (stakeInfos[msg.sender].amount * APR / 100) / yearsDuration / dayDuration; //   
        uint256 claimableAmount = persecondAmount * stakingDuration; //  

        jmt.transfer(msg.sender, claimableAmount / 10); //vjmt:jmt == 10:1  
        setStakeInfo(); //    
        emit Claimed(msg.sender, claimableAmount);

        return true;
    }

    //    
    function claimableReward() public view returns(uint256) {
        if(addressStaked[msg.sender] == true){
            uint256 stakingDuration = block.timestamp - stakeInfos[msg.sender].claimedTime; //     
            uint256 persecondAmount = (stakeInfos[msg.sender].amount * APR / 100) / yearsDuration / dayDuration; //   
            uint256 claimableAmount = persecondAmount * stakingDuration; //  
            return claimableAmount;
        }else{
            return 0;
        }
    }
}
